INSERT INTO "EASY_Widget__c" VALUES(10,'Active','','<p><strong style="font-size: 18px; color: rgb(109, 54, 150);">Next Steps for Graduates</strong></p><p><br></p><p><br></p><p><strong style="font-size: 16px; color: rgb(109, 54, 150);">Test Scores</strong></p><p><strong style="font-size: 16px;">Follow up with testing agencies to make sure your test scores were submitted, if applicable.</strong><span style="font-size: 16px;"> Testing services submit scores to the University of St. Thomas on your behalf. In most cases, this happens automatically; however, it may be a good idea to follow up with agencies to be sure your scores have been submitted.</span></p><p><span style="font-size: 16px;"> </span></p><p><strong style="color: rgb(109, 54, 150); font-size: 16px;">Transcripts</strong></p><p><strong style="font-size: 16px;">We require a bachelor’s degree from a regionally accredited U.S. institution (or the international equivalent).</strong><span style="font-size: 16px;"> Original transcripts are required from all undergraduate and graduate institutions you have attended, sent directly from the institution. If your institution offers electronic transcripts, please send them to </span><a href="mailto:gradadmissions@stthomas.edu" target="_blank" style="font-size: 16px;">gradadmissions@stthomas.edu</a><span style="font-size: 16px;">. Paper transcripts must be submitted in sealed envelopes and signed by the appropriate university official. These can be sent to: </span></p><p><br></p><p><strong style="font-size: 16px;">University of St. Thomas</strong></p><p><strong style="font-size: 16px;">Graduate Records - Admissions</strong></p><p><strong style="font-size: 16px;">1000 LaSalle Ave., Box 5</strong></p><p><strong style="font-size: 16px;">Minneapolis, MN 55403-2005</strong></p><p><br></p><p><em style="font-size: 16px;">Exception: Transcripts for advanced placement courses and study abroad transfer credits are not required.</em></p><p><br></p><p><span style="font-size: 16px;">It is recommended that international students complete applications to the evaluation service at least six months prior to the term in which they wish to start the program. We accept evaluations from the following; please work with one of them to obtain your evaluation. </span></p><p><a href="http://www.wes.org/" target="_blank" style="font-size: 16px;">World Education Services</a></p><p><a href="http://www.ece.org/" target="_blank" style="font-size: 16px;">Educational Credential Evaluators</a></p><p><br></p><p><span style="font-size: 16px;">International students may be required to submit additional supplemental documents.</span></p><p><br></p><p><span style="font-size: 16px;">Please visit our website for a full listing of international requirements: </span><a href="https://www.stthomas.edu/intl/graduate/" target="_blank" style="font-size: 16px;">https://www.stthomas.edu/intl/graduate/</a><span style="font-size: 16px;"> </span></p><p><span style="font-size: 16px;"> </span></p><p><strong style="color: rgb(109, 54, 150); font-size: 16px;">HEA Student Consumer Information</strong></p><p><span style="font-size: 16px;">The following site is provided as a resource to prospective and enrolled students and their parents, and lists the HEA required disclosures by the University of St. Thomas:</span><strong style="font-size: 16px;"> </strong><a href="https://www.stthomas.edu/policies/required-student-disclosures" target="_blank" style="font-size: 16px;">https://www.stthomas.edu/policies/required-student-disclosures</a><span style="font-size: 16px;"> </span></p>','','ApplicationPortal','Submitted App;Complete App;Pending','','','','Graduate Next Steps (GSOEd)','','5.0','','','Bottom','Central Daylight Time (America/Chicago)','Custom','3');
INSERT INTO "EASY_Widget__c" VALUES(11,'Active','','','','ApplicationPortal','Started App','','','','Pre-Checklist Text BETA 2!!!!!!!!!!(Francis) (GSOE)','<span id="tranAlertHook"></span>

	<body>

		<script type="text/javascript">

			

			document.addEventListener(''DOMContentLoaded'', function(){

				webOnlyAlert_init();

			});

			

			function webOnlyAlert_init () {

				if (!webOnlyAlert_readCookie("hide_alert_message")) {

					webOnlyAlert_getData("https://static.stthomas.edu/alert/alert_message.json"); // Don''t need this parameter anymore because I modified the function to ignore it, but I left it in to show how it used to work.

				}

				return true;

			}

			

			function webOnlyAlert_process (data) {



					webOnlyAlert_topMessage(data);

				

			}

			

			function webOnlyAlert_getData (dataURL) {

			

				/*

				// This is fanciness you don''t need for this test or for your widget, but check out https://static.stthomas.edu/alert/alert_message.json to see how it''s structured if you''re interested.

					$.ajax({

						dataType: "json",

						mimeType: "text/json",

						data: { cacheTime: 1 },

						url: dataURL,

					}).done(function (data) {

						ust.webOnlyAlert_process(data);

					});

				*/

				webOnlyAlert_process("Welcome");

			}

			

			function webOnlyAlert_createCookie (name, value, hours) {

				var expires = "";



				// This feature isn''t in the capricorn version, but ust-styles is going to insist on an expiration time

				// so a user who hides it and maintains sessions indefinitely doesn''t hide it for all eternity.



				if (!hours) {

					hours = 1;

				}



				if (hours) {

					const date = new Date();

					date.setTime(date.getTime() + hours * 60 * 60 * 1000);

					// eslint-disable-next-line//

					expires = ";Expires=" + date.toUTCString();

				}



				// eslint-disable-next-line//

				document.cookie = name + "=" + value + expires + ";Path=/";

			}

			

			function webOnlyAlert_readCookie (a) {

				// eslint-disable-next-line

				const b = document.cookie.match("(^|[^;]+)\\s*" + a + "\\s*=\\s*([^;]+)");

				return b ? b.pop() : false;

			}

			

			function webOnlyAlert_topMessage (data) {



				var header = document.querySelector("#tranAlertHook");

				var topMessage = document.createElement("div");

				topMessage.className = "top__message";

				topMessage.innerHTML = ''<span><div class="Testing"><div class="animated-text" style="text-align:left;"><div class="Welcome" style="text-align:left;"><span style="white-space:nowrap"><b>Welcome to the St. Thomas Graduate Application! &#127881</b></span></div><div class="Welcome" style="text-align:left;"><span style="white-space:nowrap"><b>Please begin your application to view specific requirements.</b></span></div></div><div class="FRappB"></div><div class="USTExitButton"><button onclick="webOnlyAlert_closeClicked()" aria-label="Close" id="close__message" class="closeButton"><Font color=white><b>X</b></Font></button></div></div></span>'';

				header.parentNode.insertBefore(topMessage, header.nextSibling);

			}

			

			function webOnlyAlert_closeClicked() {

				//webOnlyAlert_createCookie("hide_alert_message", true, 0.1); // cookie will live for 1 hour. the value is data.exp in the original, allowing the expiration date to come from the JSON object, but I broke that here.

				var topMessage = document.querySelector(".top__message");

				//topMessage.parentElement.removeChild(topMessage); //removing it for now



				var parent = topMessage.parentElement.parentElement;

				parent.parentElement.removeChild(parent);

			}

		</script>





