INSERT INTO "EASY_Widget__c" VALUES(57,'Active','Status: Accepted','<p style="text-align: center;"><strong style="font-size: 20px; color: rgb(109, 54, 150);">Congratulations! </strong></p><p style="text-align: center;"><strong style="font-size: 20px; color: rgb(109, 54, 150);">You have been accepted to the University of St. Thomas!</strong></p><p style="text-align: center;"><br></p><p style="text-align: center;"><br></p><p><span style="font-size: 16px;">What&#39;s next? Please complete your </span><a href="https://stthomas.force.com/applicantportal/apex/IntentEnrollForm" target="_blank" style="font-size: 16px;">Intent to Enroll</a><span style="font-size: 16px;"> form to confirm your enrollment.</span></p><p><br></p><p><span style="font-size: 16px;">Questions? Contact the Graduate Office of Admissions, or </span><a href="https://www.stthomas.edu/admissions/graduate/financialaidstudentresources/" target="_blank" style="font-size: 16px;">visit Graduate Student Resources</a><span style="font-size: 16px;">.</span></p>','','ApplicationPortal','Admit','','','','Graphic: GR Admit (GSSW)','','','','','Content Bottom','Central Daylight Time (America/Chicago)','Custom','8');
