    background-color: #2146ED; left: 45%; bottom: 85%; animation-delay: -2.7s;

    }

    .confetti:nth-child(30) {

    background-color: #c0e39d; left: 73%; bottom: 89%; animation-delay: -2.3s;

    }

    

    

    @keyframes confetti {

    0% { transform: rotateZ(15deg) rotateY(0deg) translate(0,0); }

    25% { transform: rotateZ(5deg) rotateY(360deg) translate(-5vw,20vh); }

    50% { transform: rotateZ(15deg) rotateY(720deg) translate(5vw,60vh); }

    75% { transform: rotateZ(5deg) rotateY(1080deg) translate(-10vw,80vh); }

    100% { transform: rotateZ(15deg) rotateY(1440deg) translate(10vw,110vh); }

    }





.animation{

animation: fadeIn 1s forwards;

transition-timing-function: cubic-bezier(0.785, 0.135, 0.15, 0.86);

}



.first{

color: #6d3696;

display: inline-flex;

position: relative;

z-index: 1;

}



.slide{

display: inline-flex;

overflow: hidden;

}



.second{

color: #6d3696;

font-weight: 100;

z-index: -1;

display: inline-flex;

animation: secondspan 1.5s forwards cubic-bezier(0.785, 0.135, 0.15, 0.86);

}



@keyframes fadeIn{



0%{

opacity: 0;

transform: scale(0);

}



50%{

opacity: 1;

transform: scale(1);

}



0%{

opacity: 1;

transform: scale(0.5);

}



}





@keyframes secondspan{



0%{

transform: translateX(-100%);

}



60%{

transform: translateX(-100%);

}



100%{

transform: translateX(0%);

}



}







