INSERT INTO "EASY_Widget__c" VALUES(130,'Inactive','','<p><strong style="background-color: rgb(255, 255, 255); font-size: 14px; color: rgb(109, 54, 150);">Please begin your application to view specific application requirements. </strong></p><p> </p>','','ApplicationPortal','Started App','','2022-09-19','16:00:00.000Z','Pre-Checklist Text (GSOE)','','5.0','2022-09-19','14:00:00.000Z','Content Top','Central Daylight Time (America/Chicago)','Custom','6');
INSERT INTO "EASY_Widget__c" VALUES(131,'Active','','<p><strong style="color: rgb(109, 54, 150); font-size: 18px;">Next Steps for Graduates</strong></p><p><br></p><p><br></p><p><strong style="font-size: 16px; color: rgb(109, 54, 150);">Transcripts</strong></p><p><strong style="font-size: 16px;">We require a bachelor’s degree from a regionally accredited U.S. institution (or the international equivalent).</strong><span style="font-size: 16px;"> Original transcripts are required from all undergraduate and graduate institutions you have attended, sent directly from the institution. If your institution offers electronic transcripts, please send them to </span><a href="mailto:gradadmissions@stthomas.edu" target="_blank" style="font-size: 16px;">gradadmissions@stthomas.edu</a><span style="font-size: 16px;">. Paper transcripts must be submitted in sealed envelopes and signed by the appropriate university official. These can be sent to: </span></p><p><br></p><p><strong style="font-size: 16px;">University of St. Thomas</strong></p><p><strong style="font-size: 16px;">Graduate Records - Admissions</strong></p><p><strong style="font-size: 16px;">1000 LaSalle Ave., Box 5</strong></p><p><strong style="font-size: 16px;">Minneapolis, MN 55403-2005</strong></p><p><br></p><p><em style="font-size: 16px;">Exception: Transcripts for advanced placement courses and study abroad transfer credits are not required.</em></p><p><br></p><p><span style="font-size: 16px;">It is recommended that international students complete applications to the evaluation service at least six months prior to the term in which they wish to start the program. We accept evaluations from the following; please work with one of them to obtain your evaluation. </span></p><p><a href="http://www.wes.org/" target="_blank" style="font-size: 16px;">World Education Services</a></p><p><a href="http://www.ece.org/" target="_blank" style="font-size: 16px;">Educational Credential Evaluators</a></p><p><br></p><p><span style="font-size: 16px;">International students may be required to submit additional supplemental documents.</span></p><p><br></p><p><span style="font-size: 16px;">Please visit our website for a full listing of international requirements: </span><a href="https://www.stthomas.edu/intl/graduate/" target="_blank" style="font-size: 16px;">https://www.stthomas.edu/intl/graduate/</a><span style="font-size: 16px;"> </span></p><p><span style="font-size: 16px;"> </span></p><p><strong style="font-size: 16px; color: rgb(109, 54, 150);">HEA Student Consumer Information</strong></p><p><span style="font-size: 16px;">The following site is provided as a resource to prospective and enrolled students and their parents, and lists the HEA required disclosures by the University of St. Thomas:</span><strong style="font-size: 16px;"> </strong><a href="https://www.stthomas.edu/policies/required-student-disclosures" target="_blank" style="font-size: 16px;">https://www.stthomas.edu/policies/required-student-disclosures</a><span style="font-size: 16px;"> </span></p>','','ApplicationPortal','Submitted App;Complete App;Pending','','','','Graduate Next Steps (GSOE)','','5.0','','','Bottom','Central Daylight Time (America/Chicago)','Custom','6');
