INSERT INTO "EASY_Widget__c" VALUES(133,'Active','Status: Accepted','<p style="text-align: center;"><strong style="font-size: 20px; color: rgb(109, 54, 150);">Congratulations! </strong></p><p style="text-align: center;"><strong style="font-size: 20px; color: rgb(109, 54, 150);">You have been accepted to the University of St. Thomas!</strong></p><p style="text-align: center;"><br></p><p style="text-align: center;"><br></p><p><span style="font-size: 16px;">What&#39;s next? Please complete your </span><a href="https://stthomas.force.com/applicantportal/apex/IntentEnrollForm" target="_blank" style="font-size: 16px;">Intent to Enroll</a><span style="font-size: 16px;"> form to confirm your enrollment.</span></p><p><br></p><p><span style="font-size: 16px;">Questions? Contact the Graduate Office of Admissions, or </span><a href="https://www.stthomas.edu/admissions/graduate/financialaidstudentresources/" target="_blank" style="font-size: 16px;">visit Graduate Student Resources</a><span style="font-size: 16px;">.</span></p>','','ApplicationPortal','Admit','','','','Graphic: GR Admit (GSOE)','','','','','Content Bottom','Central Daylight Time (America/Chicago)','Custom','6');
INSERT INTO "EASY_Widget__c" VALUES(134,'Active','','<p><strong style="color: rgb(109, 54, 150); font-size: 18px;">Next Steps for DSW</strong></p><p><br></p><p><br></p><p><strong style="font-size: 16px;">The DSW</strong><span style="font-size: 16px;"> requires a bachelor’s degree from a regionally accredited U.S. institution (or the international equivalent). and a master&#39;s degree from an MSW program accredited by the Council on Social Work Education (CSWE). Original transcripts are required from all undergraduate and graduate institutions you have attended, sent directly from the institution. If your institution offers electronic transcripts, please send them to </span><a href="mailto:gradadmissions@stthomas.edu" target="_blank" style="font-size: 16px; background-color: rgb(255, 255, 255);">gradadmissions@stthomas.edu</a><span style="font-size: 16px;">. Paper transcripts must be submitted in sealed envelopes and signed by the appropriate university official. These can be sent to:</span></p><p><br></p><p><strong style="font-size: 16px;">University of St. Thomas</strong></p><p><strong style="font-size: 16px;">Graduate Records - Admissions</strong></p><p><strong style="font-size: 16px;">1000 LaSalle Ave., Box 5</strong></p><p><strong style="font-size: 16px;">Minneapolis, MN 55403-2005</strong></p><p><br></p><p><em style="font-size: 16px;">Exception: Transcripts for advanced placement courses and study abroad transfer credits are not required.</em></p><p><br></p><p><span style="font-size: 16px;">It is recommended that international students complete applications to the evaluation service at least six months prior to the term in which they wish to start the program. We accept evaluations from the following; please work with one of them to obtain your evaluation. </span></p><p><a href="http://www.wes.org/" target="_blank" style="font-size: 16px;">World Education Services</a></p><p><a href="http://www.ece.org/" target="_blank" style="font-size: 16px;">Educational Credential Evaluators</a></p><p><br></p><p><span style="font-size: 16px;">International students may be required to submit additional supplemental documents.</span></p><p><br></p><p><span style="font-size: 16px;">Please visit our website for a full listing of international requirements: </span><a href="https://www.stthomas.edu/socialwork/dsw/admission/application/internationalapplicants/" target="_blank" style="font-size: 16px; background-color: rgb(255, 255, 255);">https://www.stthomas.edu/socialwork/dsw/admission/application/internationalapplicants/</a></p><p><br></p><p><strong style="font-size: 16px; color: rgb(109, 54, 150);">HEA Student Consumer Information</strong></p><p><span style="font-size: 16px;">The following site is provided as a resource to prospective and enrolled students and their parents, and lists the HEA required disclosures by the University of St. Thomas: </span><a href="https://www.stthomas.edu/policies/required-student-disclosures" target="_blank" style="font-size: 16px; background-color: rgb(255, 255, 255);">https://www.stthomas.edu/policies/required-student-disclosures</a></p>','','ApplicationPortal','Submitted App;Complete App;Pending','','','','DSW Next Steps (GSSW)','','6.0','','','Bottom','Central Daylight Time (America/Chicago)','Custom','8');
