INSERT INTO "Question__c" VALUES(188,'true','','','','','','','','false','','','','','2.0','false','true','','false','','','','','','Non-Degree: The option may be of interest to students with a desire to pursue graduate study but not necessarily in obtaining a degree. Enrolling in one or more courses at the non-degree status will provide contact with faculty members and an opportunity to evaluate whether the programs offerings match a student’s needs, interests, and abilities. Up to six credits taken as a non-degree student may be applied for credit towards the degree.

Audit: 2- or 3-credit courses may be audited. Auditors pay reduced tuition rates based on a percentage formula. If a student audits a class, they cannot receive graduate credit. Students who audit Kodály or Orff Schulwerk are still eligible to receive the certificate if they audit the courses.

Visit https://www.stthomas.edu/businessoffice to learn more.','false','Please use the following formula and example to list your selected course(s). Course Number and Section, Course Title, Number of Credits, Non-Degree/Audit. Please start a new line for each course.','','','','Course Registration ME ND(GCAS)','Name','false','','Example: GMUS 731, Orff Schulwerk Levels I, 3 credits, Non-Degree','012P0000002xrgnIAA','','Started App','','','','','','','36');
