INSERT INTO "Question__c" VALUES(330,'true','','','','Started App;Submitted App','','','','false','','','','','2.0','false','true','Started App','false','','','','','','','false','','','','','Application Materials Consent Text (SPSSD)','Name','false','','','012P0000002xrgvIAA','','Started App','','','<p><strong>Please affirm the following before you submit your application.</strong></p>

<p> </p>

<p> </p>

<p>I understand that I have reviewed each page of my application. I certify that the information contained in this application, including all attachments and credentials, is complete and true to the best of my knowledge. I understand that misrepresentation of application information is sufficient grounds for denial of admissions or cancellation of admissions and registration. I understand that all materials received by the University of St. Thomas in connection with this application are not returnable. <span style="color: #ff0000;">*</span></p>','','','','69');
