INSERT INTO "Question__c" VALUES(340,'false','','','','Started App;Submitted App','','','','false','','','','','','false','true','Started App','false','','','','','','','false','','','','','Tuition and Billing Static(GCAS)','Name','false','','','012P0000002xrgvIAA','','','','','Summer term tuition and fee charges begin posting to student accounts in mid-May for students enrolled in courses by that point. The first summer eBill will be generated in late May and the first payment due date will be mid-June.  After that date, eBills will be generated on a rolling basis following course enrollment.<br><br>If you need this timeline expedited for your school district’s reimbursement deadlines, please contact the <a href="https://www.stthomas.edu/businessoffice/" target="_blank">Business Office</a> at <a href="mailto:busoffice@stthomas.edu" target="_blank">busoffice@stthomas.edu</a> to discuss details. <br><br>Details regarding eBilling can be found <a href="https://stthomas.edu/businessoffice/ebilling/" target="_blank">here</a>.','','','','33');
