INSERT INTO "Question__c" VALUES(348,'true','','','','Started App;Submitted App','','','','false','','','','','','false','true','Started App','false','','','','','','','false','','','','','GPME Scholarship (GCAS)','Name','false','','','012P0000002xrgvIAA','','','','','<p><br></p><p><strong style="font-size: 20px; color: rgb(109, 54, 150);">Graduate Programs in Music Education Scholarship</strong></p><p><br></p><p><span style="font-size: 16px; color: rgb(0, 0, 0);">For Graduate Programs in Music Education scholarship information, please </span><a href="https://cas.stthomas.edu/departments/areas-of-study/music/" target="_blank" style="font-size: 16px; color: rgb(0, 0, 0);">click here</a><span style="font-size: 16px; color: rgb(0, 0, 0);"> to visit our website. Completed applications are due on or before </span><strong style="font-size: 16px; color: rgb(0, 0, 0);">April 1</strong><span style="font-size: 16px; color: rgb(0, 0, 0);"> of the current year. Notifications will be processed by </span><strong style="font-size: 16px; color: rgb(0, 0, 0);">May 1</strong><span style="font-size: 16px; color: rgb(0, 0, 0);">.  </span></p>','','','','95');
