INSERT INTO "Question__c" VALUES(402,'true','','','','Started App;Submitted App','','','','false','','','','','4.0','false','true','Started App','false','','','','','','','false','','','','','Application Changes Consent Text (GSSW)','Name','false','','','012P0000002xrgvIAA','','Started App','','','<p> </p>

<p>I understand that once my application has been submitted it may not be altered; I will need to contact the Office of Graduate Admissions via email at <a href="mailto:gradadmissions@stthomas.edu" target="_blank">gradadmissions@stthomas.edu</a> to provide additional information or make changes (ex. address change). <span style="background-color: #ffffff; color: #ff0000;">*</span></p>','','','','83');
