INSERT INTO "Question__c" VALUES(404,'true','','','','Started App;Submitted App','','','','false','','','','','15.0','false','true','Started App','false','','','','','','','false','','','','','EOE Statement (GSSW)','Name','false','','','012P0000002xrgvIAA','','','','','<p> </p><p> </p><p><strong style="color: rgb(109, 54, 150);">The University of St. Thomas is an equal opportunity educator and employer. St. Thomas does not unlawfully discriminate, in any of its programs or activities, on the basis of race, color, creed, religion, national origin, sex, sexual orientation, family status, disability, age, marital status, status with regard to public assistance, membership or activity in a local commission, genetic information or any other characteristic protected by applicable law. </strong><a href="http://www.stthomas.edu/eostatement" target="_blank"><strong>http://www.stthomas.edu/eostatement</strong></a></p><p> </p><p><strong style="color: rgb(109, 54, 150);">The University of St. Thomas is registered with the Minnesota Office of Higher Education pursuant to sections 136A.61 to 136A.71. Registration is not an endorsement of the institution. Credits earned at the institution may not transfer to all other institutions. Contact information for the Minnesota Office of Higher Education is: 1450 Energy Park Drive, Suite 350 St. Paul, MN 55108-5227 Phone: (651) 642-0567 Toll Free: (800) 657-3866 Fax: (651) 642-0675 </strong><a href="https://www.ohe.state.mn.us/" target="_blank"><strong>https://www.ohe.state.mn.us/</strong></a></p>','','','','83');
INSERT INTO "Question__c" VALUES(405,'false','','','','Started App;Submitted App','','','','false','Doctoral','','','','1.0','false','true','Started App','false','','','','','','','false','','','','','Request Recommendation Doct Static (GSPP)','Name','false','','','012P0000002xrgvIAA','','Started App','','','Two (2) letters of recommendation are required for the PsyD in Counseling Psychology application. Please provide contact information below for individuals who can attest to your skills and experience. Recommendation forms must be completed by individuals who can attest to applicant’s readiness for graduate counseling psychology education and practice, including:
<ul><li>Empathy, self-knowledge, and respect for others </li><li>Engagement as a learner, intellectual capability, written communication, and preparation for graduate education </li><li>Previous related experiences- personal, professional, or educational that would prepare the applicant for counseling psychology practice </li></ul>
<br>Only professional, community, or academic references will be considered; personal references are not acceptable. References must complete both the checklist and the accompanying statement sections of the form. A link to the recommendation form will be sent when the recommendations section of the application form has been completed. Please alert your references in advance to expect an email. These are confidential recommendations submitted directly from the references to the Office of Graduate Admissions; applicants who wish to view the recommendations are responsible for making the appropriate arrangements with their references.','','','','82');
INSERT INTO "Question__c" VALUES(406,'true','','','','Started App;Submitted App','','','','false','Master''s','','','','1.0','false','true','Started App','false','PS_DA_MA|CPSY','','','','','','false','','','','','Request Recommendation MaCP-AdmitDoct Static(GSPP)','Name','false','','','012P0000002xrgvIAA','','Started App','','','Three (3) letters of recommendation are required for this application. Please provide contact information below for individuals who can attest to your skills and experience. All recommendations should assess your ability to succeed in graduate school, exhibit appreciation and consideration for individual and cultural diversity; sensitivity to others, demonstrate intellectual and creative aptitude, provide ethical psychological services, ability to express self orally and in one&#39;s writing. (1) One letter from a faculty member who has worked closely with you, giving specific examples highlighting the candidate&#39;s potential for success with doctoral level study. (2) One letter from a supervisor familiar with your work or human service experience. The letter should assess interpersonal skills, ability to work well with clients, reliability, professional behavior, etc. (3) One letter from an individual who can attest to your skills and experiences, both interpersonal and academic.','','','','82');
INSERT INTO "Question__c" VALUES(407,'true','','','','','','','','false','Master''s','','','','1.0','false','true','','false','PS_GR_MA|CPSY','','','','','','false','','','','','Request Recommendation MaCP Static(GSPP)','Name','false','','','012P0000002xrgvIAA','','','','','Two (2) letters of recommendation are required for the PsyD in Counseling Psychology application. Please provide contact information below for individuals who can attest to your skills and experience. Recommendation forms must be completed by individuals who can attest to applicant’s readiness for graduate counseling psychology education and practice, including:
<ul><li>Empathy, self-knowledge, and respect for others </li><li>Engagement as a learner, intellectual capability, written communication, and preparation for graduate education </li><li>Previous related experiences- personal, professional, or educational that would prepare the applicant for counseling psychology practice </li></ul>
<br>Only professional, community, or academic references will be considered; personal references are not acceptable. References must complete both the checklist and the accompanying statement sections of the form. A link to the recommendation form will be sent when the recommendations section of the application form has been completed. Please alert your references in advance to expect an email. These are confidential recommendations submitted directly from the references to the Office of Graduate Admissions; applicants who wish to view the recommendations are responsible for making the appropriate arrangements with their references.','Art History','','','82');
