INSERT INTO "Question__c" VALUES(500,'true','','','','','','','','false','Master''s;Certificate','','','','0.0','false','true','','false','','','','','','','false','','','','','Dean''s Scholarship Static(GCAS)','Name','false','','','012P0000002xrgvIAA','','','','','<p style="text-align: center;"><strong style="color: rgb(109, 54, 150); font-size: 20px;">Dean&#39;s Scholarship </strong></p><p><br></p><p>In order to promote diversity among its graduate students, the College of Arts &amp; Sciences offers funds for Dean’s Scholarships for students applying to our graduate programs. These scholarships are intended for: students of color, low-income students, or students who are first-generation college graduates in their family.</p><p><br></p><p>Students are nominated by the program’s Director of Graduate Studies upon acceptance of the application. Awards will typically be granted on a per course basis and will apply for up to three years while the student remains in good standing and maintains at least a 3.5 GPA.</p><p><br></p><p>Please check this box if you feel you are a qualified candidate and would like to be considered for this scholarship opportunity.</p><p><br></p><p>Deadline for consideration is <strong>May 1</strong>. Awards will be decided and communicated by <strong>June 1</strong>.</p><p><br></p>','','','','14');
