INSERT INTO "Question__c" VALUES(824,'true','','','','','','','','false','','','','','7.0','false','true','','false','','','','','','','false','','','','','Accelerated MSW Information Static (GSSW)','Name','false','','','012P0000002xrgvIAA','','','','','The St. Thomas MSW program offers an accelerated admission process for current St. Thomas junior BSW majors. This process provides students with acceptance into the MSW program in their junior year rather than their senior year and streamlines the admissions process.<br><br>Junior students who meet all the following eligibility requirements may apply for early admission to the MSW program:
<ul><li>Admitted to the BSW major without conditions.</li><li>Cumulative GPA of 3.0, documented with a current degree evaluation.</li><li>Social work GPA of 3.5</li><li>Successful completion of all allied/supporting coursework (BIOL 105 or 106, PSYC 111, PSYC 202 and SOCI 100).</li><li>In good academic and professional standing (see the Professional Standards in BSW Handbook) in the BSW program (confirmed by BSW program director).</li><li>Completion of undergraduate degree in May of the following year</li></ul>','','','','305');
