INSERT INTO "Question__c" VALUES(862,'true','','','','Started App;Submitted App','','','','false','Doctoral','','','','1.0','false','true','Started App','false','','','','','','','false','Scholarship Information','','','','Scholarship Information (GSSW)','Name','false','','','012P0000002xrgvIAA','','','','','<p>Please indicate if you would like to be reviewed for the Barbara W. Shank scholarship based on the criteria outlined below.</p><p><br></p><p>Meet one or more of the following three criteria, with preference given to students who meet all criteria:</p><p><br></p><p>* Have experience living in a community with a majority North American Indigenous population.</p><p><br></p><p>* Have a demonstrated knowledge of the history, culture or language of one or more North American Indigenous nations.</p><p><br></p><p>* Have demonstrated experience in or commitment to working with North American Indigenous peoples.</p><p><br></p>','','','','304');
