INSERT INTO "Question__c" VALUES(943,'false','','','','','','','','false','Master''s','','','','1.0','false','true','','false','','','','','','','false','Recommender Information Static','','','','Recommender Information MS Static (GSSW)','Name','false','','','012P0000002xrgvIAA','','','','','<p>Three (3) letters of recommendation are required for the MSW application. Please provide contact information below for individuals who can attest to your skills and experience. MSW recommendation forms must be completed by individuals who can attest to applicant&#39;s readiness for graduate social work education, inlcuding: </p><p><br></p><p>• Self-reflection, engagement, and respect for others</p><p>• Engagement as a learner and preparation for graduate education</p><p>• Previous related experiences - personal, professional, or educational - that would prepare the applicant for advanced social work practice</p><p><br></p><p>Only professional, community or academic references will be considered; personal references are not acceptable. References must complete both the checklist and the accompanying statement sections of the form. A link to the recommendation form will be sent when the recommendations section of the MSW application form has been completed. Please alert your references in advance to expect an email. These are confidential recommendations submitted directly from the references to the Office of Graduate Admissions; applicants who wish to view the recommendations are responsible for making the appropriate arrangements with their references.  </p>','','','','60');
