INSERT INTO "Question__c" VALUES(1010,'false','','','','','','','','false','Master''s','','','','1.0','false','true','','false','PS_GR_MA|CPSY','','','','','','false','','','','','Request Recommendation MaCP Static(GSPP)','Name','false','','','012P0000002xrgvIAA','','','','','<p>Two (2) letters of recommendation are required for the MA in Counseling Psychology application. Please provide contact information below for individuals who can attest to your skills and experience. Recommendation forms must be completed by individuals who can attest to applicant’s readiness for graduate counseling psychology education and practice, including:</p><p><br></p><p>• Empathy, self-knowledge, and respect for others </p><p>• Engagement as a learner, intellectual capability, written communication, and preparation for graduate education </p><p>• Previous related experiences- personal, professional, or educational that would prepare the applicant for counseling psychology practice </p><p><br></p><p>Only professional, community, or academic references will be considered; personal references are not acceptable. References must complete both the checklist and the accompanying statement sections of the form. A link to the recommendation form will be sent when the recommendations section of the application form has been completed. Please alert your references in advance to expect an email. These are confidential recommendations submitted directly from the references to the Office of Graduate Admissions; applicants who wish to view the recommendations are responsible for making the appropriate arrangements with their references.</p>','Art History','','','167');
