INSERT INTO "Question__c" VALUES(1016,'false','','','','Started App;Submitted App','','','','false','Certificate','','','','1.0','false','true','Started App','false','','','','','','','false','','','','','Request Recommendation Static - Certificate(SPSSD)','Name','false','','','012P0000002xrgvIAA','','Started App','','','<p><span style="font-size: 14.6667px; font-family: Calibri; color: rgb(0, 0, 0);">Three (3) letters of recommendation are required for this application. Please provide contact information below for recommenders who can attest to your skills and experience. Your recommenders should include the following: (1) an academic reference, such as a former professor, who can speak to your academic preparedness to do graduate level course work; (2) your pastor, who should comment on those attributes that make you a suitable candidate for a leadership position in a Catholic school; and (3) your principal or direct supervisor at your school who can speak to your leadership skills and experience. If your pastor is your direct supervisor, this third letter of recommendation can be from a colleague.</span></p>','','','','168');
