INSERT INTO "Question__c" VALUES(1048,'false','','','','Started App;Submitted App','','','','false','Master''s','','','','1.0','false','true','Started App','false','PS_DA_MA|CPSY','','','','','','false','','','','','Request Recommendation MaCP-AdmitDoct Static(GSPP)','Name','false','','','012P0000002xrgvIAA','','Started App','','','Three (3) letters of recommendation are required for this application. Please provide contact information below for individuals who can attest to your skills and experience. All recommendations should assess your ability to succeed in graduate school, exhibit appreciation and consideration for individual and cultural diversity; sensitivity to others, demonstrate intellectual and creative aptitude, provide ethical psychological services, ability to express self orally and in one&#39;s writing. (1) One letter from a faculty member who has worked closely with you, giving specific examples highlighting the candidate&#39;s potential for success with doctoral level study. (2) One letter from a supervisor familiar with your work or human service experience. The letter should assess interpersonal skills, ability to work well with clients, reliability, professional behavior, etc. (3) One letter from an individual who can attest to your skills and experiences, both interpersonal and academic.','','','','173');
