INSERT INTO "Question__c" VALUES(1060,'true','','','','','','','','false','','','','','','false','true','','false','','','','','','','false','','','','','Scholarships','Name','false','','','012P0000002xrgvIAA','','','','','The first step to receiving financial aid is to complete a Free Application for Federal Student Aid (FAFSA). The FAFSA collects information required to determine whether you qualify for financial aid and how much you are eligible to receive. <a href="https://www.stthomas.edu/financialaid/graduate/" target="_blank">Click here</a> to visit Graduate Financial Services for details.<br><br>Please <a href="https://education.stthomas.edu/admissions/graduate/index.html" target="_blank">click here</a> to visit our website for current scholarship information.<br><br>The School of Education offers several part-time assistantship and work-study positions that can supplement your education funding. <a href="https://studentemployment-stthomas.icims.com/jobs/intro" target="_blank">Click here</a> to see what is available.','','','','342');
