INSERT INTO "Question__c" VALUES(1334,'true','','','','Started App','','','','false','','','','','1.0','false','true','Started App','false','','','','','','','false','Prerequisite Information','','','','Prerequisite Information (GSON)','Name','false','','','012P0000002xrgvIAA','','','','','All MSN applicants are required to have the following courses completed before they begin MSN classes. Please indicate if you&#39;ve taken or are currently taking the following courses. If you are unsure, please email nursing@stthomas.edu.<br><br>The minimum grade of an individual prerequisite must be a C- (1.7) or higher. Our minimum GPA  for admission is based on the average GPA of all six prerequisite courses. To apply for this program you must have a 3.0-grade point average for the six courses listed in the text boxes below. Meaning you may have earned a C in one course but several A or B scores in the other courses, bringing your prerequisite grade point average above a 3.0.','','','','349');
