INSERT INTO "Requirement_Item__c" VALUES(82,'True','False','False','','Started App;Submitted App','','Doctoral','','','True','True','Started App','','','','','','','','Two (2) letters of recommendation are required for the PsyD in Counseling Psychology application. Please provide contact information below for individuals who can attest to your skills and experience. Recommendation forms must be completed by individuals who can attest to applicant’s readiness for graduate counseling psychology education and practice, including:

<br>

<br>

• Empathy, self-knowledge, and respect for others 

<br>

• Engagement as a learner, intellectual capability, written communication, and preparation for graduate education 

<br>

• Previous related experiences- personal, professional, or educational that would prepare the applicant for counseling psychology practice 

<br>

<br>

Only professional, community, or academic references will be considered; personal references are not acceptable. References must complete both the checklist and the accompanying statement sections of the form. A link to the recommendation form will be sent when the recommendations section of the application form has been completed. Please alert your references in advance to expect an email. These are confidential recommendations submitted directly from the references to the Office of Graduate Admissions; applicants who wish to view the recommendations are responsible for making the appropriate arrangements with their references.','','False','False','Request Recommendation','','Request Recommendation Doct (GSPP)','','','012P0000002xrh2IAA','Application__c','Application','Recommendation__c','','','2.0','','Started App','Requirement_Item__c2022-08-25 15:12:47Z00000','','','','True','','','44');
