INSERT INTO "Requirement_Item__c" VALUES(137,'True','False','False','','Started App;Submitted App','','Doctoral','','5.0','True','True','Started App','','','','','','','','To demonstrate your academic writing skills and provide evidence of your ability to think critically and analytically please provide the following: write a paper on a topic of interest to you in social work; you may wish to consider a topic you are interested in as a focus for your banded dissertation or that relates to social work education. The writing sample should be 3-5 pages in length and formatted in APA Style, including a title page and reference section (not included in the 3-5 page limit). Examples include: essay, brief literature review, conceptual paper, or a section of a longer paper. If your writing sample is from a longer paper, it must be from the past year and you must provide a brief (2-3 sentence) introductory statement to provide context for the Reviewer.','','False','False','Writing Sample','','Writing Sample Doctor (GSSW)','','','012P0000002xrh0IAA','','','','','','','','Started App','Requirement_Item__c2022-09-02 18:18:06Z00000','','','','True','','','150');
