INSERT INTO "Requirement_Item__c" VALUES(161,'True','False','False','','Started App;Submitted App','','Master''s','','1.0','True','True','Started App','','','','','','','','Three (3) letters of recommendation are required for the MSW application. Please provide contact information below for individuals who can attest to your skills and experience. MSW recommendation forms must be completed by individuals who can attest to applicant''s readiness for graduate social work education, inlcuding: 

<br>



<br>• Self-reflection, engagement, and respect for others



<br>• Engagement as a learner and preparation for graduate education



<br>• Previous related experiences - personal, professional, or educational - that would prepare the applicant for advanced social work practice

<br>

<br>

Only professional, community or academic references will be considered; personal references are not acceptable. References must complete both the checklist and the accompanying statement sections of the form. A link to the recommendation form will be sent when the recommendations section of the MSW application form has been completed. Please alert your references in advance to expect an email. These are confidential recommendations submitted directly from the references to the Office of Graduate Admissions; applicants who wish to view the recommendations are responsible for making the appropriate arrangements with their references.  ','','False','False','Recommender Information','3.0','Recommender Information Masters (GSSW)','','','012P0000002xrh2IAA','Application__c','Application','Recommendation__c','','','3.0','','Started App','Requirement_Item__c2022-09-02 16:47:46Z00000','','','','True','','','146');
