INSERT INTO "Requirement_Item__c" VALUES(167,'True','False','False','','Started App;Submitted App','','','','','True','True','Started App','','','PS_GR_MA|CPSY','','','','','Two (2) letters of recommendation are required for the MA in Counseling Psychology application. Please provide contact information below for individuals who can attest to your skills and experience. Recommendation forms must be completed by individuals who can attest to the applicant’s readiness for graduate counseling psychology education and practice, including:

<br>

<br>

• Empathy, self-knowledge, and respect for others 

<br>

• Engagement as a learner, intellectual capability, written communication, and preparation for graduate education 

<br>

• Previous related experiences- personal, professional, or educational that would prepare the applicant for counseling psychology practice 

<br>

<br>

Only professional, community, or academic references will be considered; personal references are not acceptable. References must complete both the checklist and the accompanying statement sections of the form. A link to the recommendation form will be sent when the recommendations section of the application form has been completed. Please alert your references in advance to expect an email. These are confidential recommendations submitted directly from the references to the Office of Graduate Admissions; applicants who wish to view the recommendations are responsible for making the appropriate arrangements with their references.','','False','False','Request Recommendation','','Request Recommendation MaCP (GSPP)','','','012P0000002xrh2IAA','Application__c','Application','Recommendation__c','','','2.0','','Started App','Requirement_Item__c2022-08-25 15:12:47Z00000','','','','True','','','44');
INSERT INTO "Requirement_Item__c" VALUES(168,'True','False','False','','Started App;Submitted App','','Certificate','','1.0','True','True','Started App','','','','','','','','Three (3) letters of recommendation are required for this application. Please provide contact information below for recommenders who can attest to your skills and experience. <br><br>Your recommenders should include the following: (1) an academic reference, such as a former professor, who can speak to your academic preparedness to do graduate level course work; (2) your pastor, who should comment on those attributes that make you a suitable candidate for a leadership position in a Catholic school; and (3) your principal or direct supervisor at your school who can speak to your leadership skills and experience. If your pastor is your direct supervisor, this third letter of recommendation can be from a colleague.','','False','False','Recommender Information','','Recommender Information Cert (SPSSD)','','','012P0000002xrh2IAA','Application__c','Application','Recommendation__c','','','3.0','','Started App','Requirement_Item__c2022-08-25 15:12:47Z00000','','','','True','','','65');
INSERT INTO "Requirement_Item__c" VALUES(169,'True','False','False','','','','','','2.0','True','False','','','','','','','','','<center><Font size=4 Font color=#6d3696><b>Dean''s Scholarship</b></Font></center>

<br>

Merit-based scholarships are available to select candidates with strong applications. All applicants are automatically considered for the Dean’s Scholarship. No separate essay is required.

<br>

<br>

<center><Font size=4 Font color=#6d3696><b>Diversity and Inclusion Scholarship</b></Font></center>

<br>

Scholarships are available to applicants who demonstrate a history of academic and professional success, leadership, service, and engagement in cultural or cross-cultural initiatives in previous academic, professional, or volunteer settings. Strong candidates will be domestic candidates with two or more years of full-time work experience after college graduation, have a strong undergraduate academic record, and show evidence of committed involvement in activities, programs, or initiatives that foster inclusion, cross-cultural awareness, or a commitment to diversity in its many forms. To be considered, review the scholarship requirements on our website and submit a statement (no more than 300 words) describing the most relevant experiences that qualify you for this award.','','False','False','Diversity and Inclusion Scholarship','','Diversity and Inclusion Scholarship - MBA(GOCB)','','','012P0000002xrh0IAA','','','','','','','','','Requirement_Item__c2022-09-02 15:23:54Z00000','','','','True','','','16');
