INSERT INTO "Requirement_Item__c" VALUES(173,'True','False','False','','Started App;Submitted App','','','','','True','True','Started App','','','PS_DA_MA|CPSY','','','','','Three (3) letters of recommendation are <i>required</i> for this application. Please provide contact information below for individuals who can attest to your skills and experience. All recommendations should assess your ability to succeed in graduate school, exhibit appreciation and consideration for individual and cultural diversity; sensitivity to others, demonstrate intellectual and creative aptitude, provide ethical psychological services, and ability to express self orally and in one''s writing.

<br>

<br> (1) One letter from a faculty member who has worked closely with you, giving specific examples highlighting the candidate''s potential for success with the doctoral-level study. 

<br>(2) One letter from a supervisor familiar with your work or human service experience. The letter should assess interpersonal skills, ability to work well with clients, reliability, professional behavior, etc. 

