INSERT INTO "Requirement_Item__c" VALUES(314,'True','False','False','','Started App;Complete App','','Master''s','','2.0','True','True','Started App','','','','','','','','The personal statement component of your application to the MSW Program at the University of St. Thomas will be used to assess your writing, critical thinking, and capacity for self-awareness and self-reflection in terms of readiness for graduate level work and supervised practice in the field. Please respond to each of the following questions in no more than two (2) pages, doubled spaced.

<br>

<br>

1. Please describe your personal, educational, volunteer, or professional experiences, qualifications or qualities that led to your interest in pursuing a master’s degree in social work at the University of St. Thomas. 

</br>

<br>

2. What are your professional goals? What are ways in which the School of Social Work at the University of St. Thomas can support your professional aspirations? 

</br>

<br>

3. The below statement from the Council on Social Work Education is a description of one of the nine core competencies, Engage Diversity and Difference in Practice, MSW students should attain during the course of their MSW degree. Please review the description and describe how you will engage diversity and difference in practice through your professional goals you identified in the previous question.  

<p><ul><li>Social workers understand how diversity and difference characterize and shape the human experience and are critical to the formation of identity. The dimensions of diversity are understood as the intersectionality of multiple factors including but not limited to age, class, color, culture, disability and ability, ethnicity, gender, gender identity and expression, immigration status, marital status, political ideology, race, religion/spirituality, sex, sexual orientation, and tribal sovereign status. Social workers understand that, as a consequence of difference, a person’s life experiences may include oppression, poverty, marginalization, and alienation as well as privilege, power, and acclaim.</li></ul>

<p><ul><li>Social workers also understand the forms and mechanisms of oppression and discrimination and recognize the extent to which a culture’s structures and values, including social, economic, political, and cultural exclusions, may oppress, marginalize, alienate, or create privilege and power. Social workers:</li></ul>

<p><ul><ul><li>Apply and communicate understanding of the importance of diversity and difference in shaping life experiences in practice at the micro, mezzo, and macro levels</li></ul></ul>

<p><ul><ul><li>Present themselves as learners and engage clients and constituencies as experts of their own experiences</li></ul></ul>

<p><ul><ul><li>Apply self-awareness and self-regulation to manage the influence of personal biases and values in working with diverse clients and constituencies.</li></ul></ul>

</br>

