INSERT INTO "Requirement_Item__c" VALUES(319,'False','False','False','','Started App','','Master''s','','1.0','True','True','Started App;Complete App','','','','','','','','This section of the application provides an opportunity to demonstrate your written communication skills, understanding of an issue relevant to social work, ability to critically assess the dimensions of the issue and preparation for graduate-level writing.

