INSERT INTO "Requirement_Item__c" VALUES(350,'True','False','False','','','','','','','True','True','','','','','','','','','Please submit a (1-2) page responses to the following questions. This resume information section includes questions about any paid or unpaid experiences related to health care, service, leadership or involvement with teams, and community-based social justice activities. If the experience(s) occurred with a formal organization(s), please include the organization(s) name, address, and contact person with whom you worked. 

<br>

<br>

(1) Health or Service-Related Experiences: Include paid or unpaid roles where you provided care or service. For example, health-related work in an employment setting, caring for an ill family member, or providing service for customers or clients. If your experience was with an organization(s), please list the organization name(s), address, and contact person.

<br>

(2) Team or Partnership Experiences: Include experiences where you had a paid or unpaid role on a team. For example, leading a committee or initiative or working with a team to organize events or clubs. If your experience was with an organization(s), please list the organization name(s), address, and contact person.

<br>

(3) Community-Based Social Justice Experiences: Include activities that demonstrate your experience in advancing Diversity, Equity, and Inclusion (DEI). For example, DEI-related lived experiences, attending and/or participating in diversity workshops, paid employment or volunteer work with an organization that promotes social justice, participation in community events, or continuing education related to DEI and social justice. If your experience was with an organization(s), please list the organization name(s), address, and contact person.

<br>

<br>

