INSERT INTO "Requirement_Item__c" VALUES(361,'True','False','False','','Started App','','','','1.0','True','True','Started App','','PDF;DOC;TXT;RTF','BU_BA_MS|BUAT','','','','','<center><b><Font size=4 Font color=#6d3696>Essay</b></Font><Font color=Red>*</Font></center>

<br>

1. Strong quantitative skills are necessary for success in this program. Please provide specific evidence of your quantitative ability from your past academic coursework in math, statistics, etc. Additionally, describe how you use these skills in your current or past career roles. <b>(500 words)</b>

<br>

<br>

2. Comfort with learning new technology and software applications is critical in

business analytics, so students will be exposed to several analytics tools, business intelligence software, and programming languages during the program (“R” statistical programming language, SPSS, SQL, Tableau, etc.) Please tell us about your comfort and experience with using technology and software, and provide a specific example of when you were asked to solve a problem with little to no direction and in order to be successful you adapted a new technology or software. <b>(500 words)</b>

